    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,62.3622,542.7086)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:12px;font-family:Minion;-inkscape-font-specification:Minion-Regular;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text102"><tspan
         x="0 7.6079998 12.84 17.1012 22.1052 28.6572 31.693199 35.366402 40.371601 46.923599 51.183601 56.187599 62.739601 65.775597 71.990402 78.159599 82.563599 85.599602 88.791603 91.827599 96.832802 103.3848 106.4208 109.4448 112.6368 115.7184 118.7424 123.7824 126.8184 132.86639 138.23039 141.2664 144.29041 147.48241 153.81841 157.5264 160.56239 167.1144 173.2836 177.54359 183.87959 186.9156 190.42081 196.58881 200.9928 204.02879 211.50481 216.7368 223.2888 229.58881 234.59399 238.974 243.23399 245.75639 248.7924 254.7576 260.92679 265.33081 268.36679 272.14441 276.40561 281.44559 284.4816 289.71359 294.11761 297.15359 301.4136 304.60559 310.9068 315.91199 322.46399 325.5 331.65601 334.67999 339.80161 345.28561 348.32159 354.71759 359.72281 366.27481 372.5748 377.61481 381.87479 384.9108 390.7908 396.0228 399.7308 402.76682 413.18399 419.35321 425.90521 430.16519 433.2012 438.68521 446.5332 452.41321 454.93561 457.97159 466.74481 473.22479 479.77679"
         y="0"
         id="tspan72">Karen Jensen bor i en lille by lidt nord for Randers. For tre år siden blev hendes kat Mons væk. Hun </tspan><tspan
         x="0 2.9651999 9.4452 15.3252 20.9916 26.054399 32.355598 37.395599 40.431599 46.7328 51.736801 58.288799 61.324799 67.804802 74.1408 77.176804 80.368797 83.4048 89.800797 94.830002 100.1244 105.1284 111.6804 114.7164 120.8856 130.77361 133.8096 143.6976 149.8656 154.26961 159.7188 164.72279 171.2748 176.28 182.832 185.3544 188.3904 194.3904 200.3904 206.3904 212.3904 218.3904 224.3904 230.3904 236.3904 242.3904 248.3904 254.3904 260.39041 266.39041 272.39041 278.39041 284.39041 287.42639 293.76239 298.99438 302.0304 308.3316 313.4064 317.11441 320.15039 326.3064 329.33041 334.45319 339.93719 342.97321 348.2052 351.74521 355.3476 360.35281 366.90479 369.42719 372.4632 378.10559 384.27481 394.16281 397.19879 403.49881 408.504 415.056 418.09201 421.284 427.164 432.83041 437.87039 440.9064 447.3024 450.3624 455.36639 465.25439 468.29041 471.48239 476.93039 481.93561 488.48761 491.01001"
         y="27"
         id="tspan74">lukkede den ud i haven om morgenen, ________________ da det blev aften, kom den ikke hjem igen. </tspan><tspan
         x="0 7.6079998 12.84 17.1012 22.1052 28.6572 31.693199 35.953201 42.2892 48.769199 53.173199 58.645199 62.247601 67.287598 70.323601 75.3396 78.879601 82.482002 87.487198 91.891197 94.9272 100.8072 106.0392 109.7472 113.3496 118.3536 124.9056 127.9416 134.3376 140.5416 144.80161 147.8376 152.0976 155.2896 161.8416 166.88161 169.9176 176.4696 181.7016 187.9164 194.1552 199.1604 202.8936 205.416 208.452 218.34 223.3452 229.8972 232.9332 239.23441 244.23959 248.6436 251.6796 257.17441 262.4064 266.81039 269.84641 275.84641 281.84641 287.84641 293.84641 299.84641 305.84641 311.84641 317.84641 323.84641 329.84641 335.84641 341.84641 347.84641 353.84641 359.84641 365.84641 368.3688 371.40479 377.70599 382.71121 387.1152 390.15121 396.54721 401.57639 406.8924 413.1936 418.23361 421.26959 425.5296 430.60559 434.3136 437.34961 443.65079 448.65601 455.20801 457.73041 460.76639 466.47839 471.71039 474.7464 479.00641 484.2384 487.94641 491.54761 496.58759"
         y="81"
         id="tspan76">Karen spurgte efter katten hos sine naboer, men der var ________________, der havde set den. Så satte </tspan><tspan
         x="0 6.3252001 12.8052 19.357201 22.3932 28.7292 31.753201 36.985199 42.8652 48.097198 51.6996 56.7048 61.108799 64.144798 74.032799 79.096802 85.4328 88.468803 93.543602 97.251602 100.2876 106.4328 109.6248 112.7064 115.7304 120.7944 127.0956 132.1356 135.1716 140.40359 144.3 147.336 157.7532 163.92239 170.4744 174.73441 177.7704 183.9156 190.2516 193.2876 196.4796 199.51559 205.91161 210.9744 213.9984 219.03841 222.0744 228.1236 233.3436 238.3488 244.9008 247.422 250.45799 257.0112 260.71921 263.75519 270.09119 275.32321 279.7272 282.76321 289.24319 294.69119 299.69641 304.1004 307.13641 312.1524 315.69241 319.2948 324.29999 328.70401 331.73999 337.2348 342.4668 346.87079 349.9068 356.20801 361.2132 365.61719 368.6532 373.6572 380.2092 383.24521 393.13321 398.3652 404.91721 411.2532 414.28922 417.82919 422.32681 427.55881 430.59479 438.06961 443.30161 449.85361 456.15479 461.16 465.54001 469.79999 472.32239 475.3584 481.65961 486.6636 491.0676"
         y="108"
         id="tspan78">hun plakater med et billede af Mons op i hele byen. Et par uger efter var der en mand fra Randers, der </tspan><tspan
         x="0 4.5359998 7.7280002 14.28 19.728001 24.7908 31.091999 36.132 39.167999 42.910801 46.102798 49.126801 52.1628 58.5588 63.563999 70.115997 76.416 81.456001 83.979599 87.015602 93.711601 98.943604 101.9796 107.274 112.4568 115.5168 120.522 127.074 130.11 133.614 139.7832 144.28081 149.5128 156.0648 159.1008 163.36079 166.5528 170.2608 173.2968 179.62199 186.10201 190.362 193.39799 199.79401 204.8232 210.1404 216.4416 221.4816 224.51759 230.9136 236.1456 242.6976 245.7336 252.2856 258.51361 264.1524 267.17639 272.2164 275.25241 281.58841 286.8204 292.2684 297.30841 300.34439 303.8844 310.08841 314.4924 317.52841 321.06839 327.5484 334.1004 340.40161 345.47641 349.18439 352.2204 357.2244 363.7764 366.81241 372.81241 378.81241 384.81241 390.81241 396.81241 402.81241 408.81241 414.81241 420.81241 426.81241 432.81241 438.81241 444.81241 450.81241 456.81241 462.81241 465.84839 471.72839 476.96039 480.6684 483.1908"
         y="135"
         id="tspan80">ringede til hende. På vejen foran sit hus havde han nogle dage før fundet en ________________ kat, </tspan><tspan
         x="0 6.3011999 11.3052 15.7092 18.745199 21.769199 24.961201 30.565201 37.117199 42.18 48.481201 53.521198 56.557201 66.974403 73.1436 79.695602 83.955597 86.477997 89.514 98.272797 103.278 109.83 112.866 118.3608 123.5928 127.9968 131.03281 137.19 140.214 145.3356 150.6288 155.7048 159.4128 162.44881 168.3288 174.53281 179.1396 182.8476 185.88361 192.43559 197.4984 203.8344 206.87041 212.1024 216 219.036 224.03999 230.592 233.62801 239.77319 242.96519 245.9892 248.5116 251.54761 260.30759 265.31161 271.86359 277.39441 282.6264 289.17841 294.65039 297.6864 303.34921 306.5412 312.8772 317.13721 320.7384 325.77841 328.81439 335.21039 340.44241 346.99438 350.0304 353.22241 359.10239 364.7688 369.80881 372.33121 375.36719 381.46439 387.12601 390.31799 394.578 397.61401 403.49399 408.72601 412.43399 415.47 421.77121 426.84601 430.55399 433.59 439.086 444.31799 448.04999 450.57239 453.6084 457.86841 463.1004 466.13641 472.53241 477.7644 484.31641"
         y="162"
         id="tspan82">der lignede Mons. Den var blevet kørt ned af en bil. Dengang vidste han ikke, hvis kat det var, så han </tspan><tspan
         x="0 6.2147999 11.3016 16.9056 21.4032 26.433599 31.726801 36.7896 43.090801 48.130798 51.166801 57.467999 62.472 69.024002 72.059998 75.251999 78.288002 82.547997 85.739998 92.292 95.328003 101.724 106.7532 112.0464 117.0864 119.61 122.646 128.8728 134.3448 137.3808 143.77679 149.0088 155.56081 158.5968 162.8568 168.08881 171.1248 177.4248 182.4648 186.72479 192.2088 200.05679 204.5928 208.8528 213.89281 216.9288 220.4688 226.67281 231.0528 235.31281 239.0208 242.05679 248.39281 251.41679 256.6488 262.52881 267.7608 271.36319 276.36841 280.854 287.40601 292.44601 295.48199 305.37 310.4328 316.7688 319.80481 330.22198 336.3912 342.94321 347.20319 350.2392 356.41919 361.65121 367.09921 372.1152 375.65521 379.2576 384.26279 387.996 390.5184 393.55441 401.16241 406.39441 410.65439 415.65961 422.21161 425.24759 430.74359 435.97559 440.37961"
         y="189"
         id="tspan84">begravede den i sin have, og han så desværre først plakaterne med Mons bagefter. Karen var </tspan><tspan
         x="0 6 12 18 24 30 36 42 48 54 60 66 72 78 84 90 96 99.036003 104.7024 109.7652 116.1012 119.1372 124.3692 128.2668 131.3028 136.53481 140.2428 143.27879 149.6748 155.8788 160.13879 165.1788 167.7012 170.7372 175.96919 179.6772 182.7132 193.1304 199.2984 205.8504 210.1104 213.14639 218.6424 223.8744 228.2784 231.31441 237.65041 243.8544 250.1904 252.7128 255.74879 266.13 271.13519 277.68719 280.72321 287.0484 293.52841 300.08041 303.11639 307.3764 312.74039 319.29239 322.89481 327.93481 332.19479 335.2308 341.45761 347.0004 351.26041 356.4924 359.0148 362.05081 367.28281 370.99081 374.02679 380.32681 385.40161 389.10959 392.1456 397.64041 402.87241 407.2764 410.31241 414.81 420.04199 424.64761 428.35559 431.3916 436.6236 440.3316 443.36761 449.0304 452.22241 458.5224 463.56241 466.08481 469.12079 475.21799 480.71399 485.96881 492.30481"
         y="216"
         id="tspan86">________________ ked af at høre, at Mons var død. Men hun syntes også, at det var rart at vide, hvad </tspan><tspan

         y="243"
         id="tspan88">der var sket med ________________ kat. </tspan><tspan

         y="270"

         y="297"
         id="tspan92">________________ for at drikke morgenkaffe. På terrassen sad Mons nemlig! Da Karen åbnede døren, </tspan><tspan

         y="324"
         id="tspan94">gik den ind i ________________ og lagde sig på sin gamle plads på sofaen. </tspan><tspan

         y="351"
         id="tspan96">Ingen ved, hvor Mons var henne i de tre år, den ikke var hos Karen Jensen. Der er heller ikke nogen, der </tspan><tspan

    <text

       id="text150"><tspan
         x="0 5.6532001 11.1504 16.322399 23.090401 29.6304 32.270401 37.4436 42.231602 44.871601 51.543598 58.142399 61.478401 69.4944 74.546402 78.518402 81.158401 91.119598 97.791603 102.498 107.67 112.458 115.098 121.422 127.146 129.786 136.47 142.002 146.78999 149.42999 155.106 163.12199 167.8284 173.0712 177.0432 179.6832 185.21519 191.9832 196.6512 202.1832 206.1552 208.7952 212.25121 214.8912 220.13519 224.10719 226.74719 233.1696 238.8096 244.5912 250.2924 255.47639 259.30441 262.76041 267.76199 277.79401 283.32599 285.966 289.422 292.06201 296.1156 299.57159 302.21161 307.74359 311.86081 314.44321 317.08319 327.3924 332.56561 339.33359 341.9736 348.47879 353.72159 357.6936 360.33359 365.50562 370.29361 372.93359 379.4736 385.00562 389.8992 393.2352 396.69119 402.3912 407.59921 410.2392 414.29279 417.74881 424.254 429.42719 434.21521 436.85519 440.64841 446.9136 451.7016 454.34161 460.76401 466.4028 472.18561 477.88559 483.0936 487.23361"
         y="0"
         id="tspan142">Svend er udlært murer og har været ansat i et byggefirma i ti år. Men det er dårlige tider for bygge- </tspan><tspan
         x="0 6.4572001 11.3496 16.881599 23.649599 28.667999 35.352001 40.523998 47.292 49.874401 52.5144 57.1824 62.714401 65.354401 72.052803 78.7248 81.364799 88.048798 93.580803 98.368797 101.0088 107.6928 113.2248 119.9928 122.6328 127.3008 131.2728 136.80479 141.85561 145.746 150.9888 154.9608 157.6008 162.2688 165.72479 169.69679 172.33681 177.6144 183.3156 188.5584 192.5304 195.17039 198.50639 201.9624 205.35719 208.69321 213.9012 216.5412 221.7144 228.48241 238.5144 244.0464 250.81441 257.3544 262.0224 265.8504 269.3064 274.30801 284.34 289.87201 292.45441 295.09439 304.0968 309.62881 316.39679 319.0368 325.72079 329.11679 337.13281 340.46881 347.0556 352.2276 357.01559 359.65561 363.4476 369.74759 373.08359 379.2876 381.92761 391.95959 397.19159 403.7316 406.37161 411.03961 414.9408 421.20599 426.25681 430.22879 432.8688 439.19281 444.91681 447.55679 452.22479 462.25681 467.78879 471.7608 474.40079 480.89279 486.4248 492.92999 498.138"
         y="15.996"
         id="tspan144">branchen, så nu har han startet sit eget lille enmandsfirma. Han hjælper folk med stort og småt både </tspan><tspan
         x="0 6.6719999 13.1772 18.385201 21.0252 27.348 33.071999 35.712002 39.167999 45.936001 52.439999 57.647999"
         y="31.992001"
         id="tspan146">ude og inde.</tspan><tspan
         x="0"
         y="71.987999"
         id="tspan148"> </tspan></text>

       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:12px;font-family:Minion;-inkscape-font-specification:Minion-Regular;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text164"><tspan
         x="0 6.6479998 13.2 18.730801 23.962799 30.514799 35.986801 39.0228 44.518799 49.750801 54.1548 57.1908 62.665199 67.958397 72.9636 79.515602 85.851601 88.887604 94.119598 100.6716 104.9316 110.1636 113.8716 116.9076 120.0996 123.1356 128.21159 131.9196 134.9556 141.00481 146.3448 151.8396 157.2888 162.30479 165.8448 169.0368 173.5224 183.4104 188.6424 191.67841 195.9384 202.1076 211.99561 215.0316 224.8488 231.3288 235.58881 240.59399 244.32719 246.84959 249.8856 258.85199 263.85721 268.2612 271.29721 277.17719 283.6572 290.2092 296.7612 301.80121 304.83719 311.23318 316.46521 323.01721 326.05319 329.24521 335.12521 340.7916 345.8316 348.86761 353.12759 358.1904 361.0968 366.58081 369.61679 375.8316 380.87161 385.13159 388.73401 393.7392 403.6272 413.5152 418.55521 421.07761 424.11359 430.21078 435.7056 440.96161 447.29761 450.33359 456.72961 461.96161 468.51361"
         y="0"
         id="tspan158">Engang var Svend ansat i et byggefirma som murer. Her kunne han ikke selv bestemme, hvad han </tspan><tspan
         x="0 4.2600002 10.14 16.620001 19.702801 22.726801 27.7668 30.802799 33.826801 38.855999 44.1492 49.189201 51.711601 54.747601 61.395599 67.947601 70.983597 77.319603 82.551598 88.023598 91.059601 100.9476 104.1396 108.3996 112.002 117.0648 123.366 128.40601 131.442 137.838 143.07001 149.62199 152.658 156.918 160.11 163.81799 166.854 169.914 176.10719 181.99921 184.52161 187.5576 191.06281 197.23199 201.492 207.828 211.02 214.056 220.35719 225.43201 229.14 232.17599 237.78 240.972 246.85201 249.888 256.224 261.45599 265.9068 268.93079 272.1228 277.59479 281.3028 284.33881 287.84399 294.01199 298.41599 301.452 304.992 308.18399 312.67081 322.55881 327.8136 332.8884 336.59641 339.1188 342.15479 350.67719 357.1572 360.19321 366.5892 371.8212 376.22519 379.2612 385.6572 390.88919 397.44119 400.4772 404.73721 407.9292 411.63721 414.67319 419.7612 425.2092 430.284 433.992 437.02802 440.56799 443.76001 448.24561 458.13361 463.3656 465.888"
         y="26.004"
         id="tspan160">skulle lave. En dag mistede han sit job, fordi det gik dårligt for firmaet. Nu har han sit eget firma, </tspan><tspan
         x="0 6.0971999 11.3784 17.5476 21.951599 24.9876 31.3836 36.615601 43.167599 46.203602 50.4636 55.526402 58.4328 63.916801 66.952797 73.1688 78.208801 82.468803 86.071198 91.075203 100.9632 110.8512 115.8564 120.2604 123.2964 128.5284 131.5524 135.26041 137.78281 140.8188 149.5788 154.6548 158.36279 161.3988 166.8708 172.1028 176.50681 179.5428 183.8028 187.5108 192.76559 199.10159 202.29359 207.76559 210.80161 217.1376 222.3696 226.8204 229.84441 233.03641 238.50841 242.2164 245.2524 248.7576 254.9256 259.32959 262.3656 267.84 273.13321 278.1384 284.6904 291.0264 295.28641 298.32239 303.85321 309.08521 318.97321 321.99719 327.0372 330.07321 333.61319 336.80521 341.2908 351.1788 356.4108 358.9332 361.96921 367.96921 373.96921 379.96921 385.96921 391.96921 397.96921 403.96921 409.96921 415.96921 421.96921 427.96921 433.96921 439.96921 445.96921 451.96921 457.96921 460.49161"
         y="52.007999"
         id="tspan162">hvor han selv bestemmer alt. Det går stadig dårligt for Svends gamle firma. ________________. </tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,73.7007,322.229)"
       style="font-variant:normal;font-weight:bold;font-stretch:normal;font-size:12px;font-family:'Minion Bold';-inkscape-font-specification:Minion-Bold;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"

    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,103.4607,322.229)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:12px;font-family:Minion;-inkscape-font-specification:Minion-Regular;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text182"><tspan
         x="0 5.4744 10.7676 15.7728 22.3248 28.660801 31.6968 35.439602 38.631599 41.655602 47.703602 52.924801 59.2248 64.230003 68.634003 71.669998 76.902 80.610001 83.646004 89.526001 92.550003 97.781998 102.042 107.082 110.118 113.622 119.7912 124.1712 128.4312 134.0976 139.16161 142.24319 145.2672 148.4592 153.9084 158.94839 161.98441 168.12959 174.51241 180.0432 185.0724 190.3656 195.3708 199.7748 202.81081 206.31599 212.48399 216.888 219.924 223.4292 229.63319 232.6572 238.5372 241.5732 251.4612 256.52399 262.85999 265.896 272.22119 278.7012 282.96121 285.99719 292.22519 297.6972 300.73318 307.12921 312.15839 317.4516 322.49161 325.01401 328.04999 337.06439 342.29639 348.84839 351.8844 361.7724 367.00439 370.02841 375.0336 379.43759 382.4736 388.70041 394.17239 397.2084 401.4696 406.49759 412.83359 418.06561 422.32559 427.33081 431.59079 436.59601 441 444.03601 447.228 453.78 460.08121 465.12119 468.1572 474.38519 479.85721"
         y="0"
         id="tspan170">Svend tilbyder at klare forskellige opgaver for folk med hus og have. Han maler og reparerer inde og </tspan><tspan
         x="0 6.48 12.7812 17.821199 20.343599 23.379601 32.392799 37.624802 44.1768 47.212799 53.692799 60.028801 64.288803 70.1688 73.360802 76.900803 80.503197 85.507202 89.911201 92.947197 98.610001 101.802 108.354 114.654 121.134 126.1392 130.5432 133.57919 139.806 145.278 148.314 154.64999 160.854 165.1152 170.1552 172.6776 175.71359 181.9404 187.4124 190.44839 196.54559 202.2084 205.40041 209.6604 212.6964 218.9964 224.0016 228.40559 231.4416 236.44679 240.8508 243.8868 247.4268 252.6588 255.6828 261.98279 267.05759 270.76559 273.80161 278.80679 285.3588 288.39481 292.10281 297.33481 302.8764 307.13641 310.7388 315.74399 322.29599 325.332 331.884 336.94681 343.28281 345.80521 348.84119 353.1012 360.94919 364.6572 368.25961 373.2648 377.66879 380.7048 387.1008 392.33279 398.8848 401.92081 406.9248 413.47681 416.51279 422.78879 428.1528 431.18881 437.33521 443.38321 445.90561 448.94159 457.95599 463.18799 469.73999"
         y="26.004"
         id="tspan172">ude. Han udskifter vinduer og døre, og hvis der er faldet en tagsten ned, sætter han en ny op. Han </tspan><tspan
         x="0 6.1691999 10.4292 16.7652 23.3172 28.322399 32.726398 35.762402 42.158401 47.187599 52.480801 57.520802 60.556801 66.7836 72.2556 75.291603 85.179604 90.266403 95.715599 100.7904 104.4984 107.5344 112.7664 119.3184 125.6184 130.6944 134.4024 136.9248 139.9608 145.4352 150.72839 155.7336 162.2856 168.6216 171.65759 176.7204 179.7444 184.00439 189.67081 194.67599 199.08 202.116 206.37601 209.56799 213.276 216.312 222.5892 227.8092 232.8492 235.88519 241.1172 245.664 251.88 257.06281 260.1228 266.42401 271.46399 274.5 280.72681 286.19879 289.2348 293.49481 298.8588 305.4108 310.45081 314.71078 317.23318 320.2692 325.50119 329.2092 332.24521 337.4772 340.56 343.58401 348.62399 351.66 357.80521 364.18799 369.71881 374.74799 380.0412 385.04639 389.45041 392.48639 397.49161 401.8956 404.93161 409.19159 415.52759 423.37561 429.92761 436.22879 441.23401 447.78601 454.086 459.12601 461.64841 464.68439 473.4444 478.44958 482.85361"
         y="52.007999"
         id="tspan174">ordner have og meget andet. Svend elsker sit nye arbejde og synes, at alle opgaver er spændende. Der </tspan><tspan
         x="0 5.0051999 9.4091997 12.4452 18.325199 24.805201 31.357201 34.3932 39.433201 45.985199 49.021198 52.765202 55.957199 62.509201 68.124001 70.6464 73.682404 80.0784 85.310402 91.862396 94.898399 98.090401 103.9704 109.6356 114.6756 117.7116 123.5916 128.82359 135.3756 138.41161 141.43559 144.62759 150.9276 155.96761 159.0036 164.298 169.36079 175.69679 178.7328 183.9648 187.67281 190.7088 196.19279 204.0408 208.3008 213.34081 216.3768 220.6368 225.70081 228.60719 234.0444 238.3044 242.01241 249.8604 256.41241 262.74841 265.9404 271.55521 274.07761 277.11359 283.66559 288.66959 298.55759 301.5816 304.77359 310.24561 313.28159 319.61761 324.84961 331.18561 334.37759 338.87521 344.10721 348.65399 354.87 360.0528 363.11279 369.414 374.4888 378.19681 380.71921 383.75519 389.75519 395.75519 401.75519 407.75519 413.75519 419.75519 425.75519 431.75519 437.75519 443.75519 449.75519 455.75519 461.75519 467.75519 473.75519 479.75519 482.27759"
         y="78.012001"
         id="tspan176">er kun én ting, han ikke kan lide ved at være selvstændig, nemlig papirarbejdet. ________________. </tspan><tspan
         x="0 5.9664001 12.1344 16.538401 19.5744 25.874399 30.879601 35.2836 38.319599 42.579601 48.459599 53.691601 56.715599 59.751598 64.011597 69.891602 74.426399 77.500801 82.795197 87.835197 92.0952 95.131203 99.391197 104.478 110.082 116.634 119.826 126.378 131.826 136.83 141.23399 144.27 150.75 157.086 159.6084 162.64439 168.87241 174.34441 177.3804 182.6124 185.6364 189.34441 192.3804 198.6804 203.75639 207.4644 210.5004 216.80161 221.80679 226.2108 229.2468 239.1348 244.1976 250.5336 253.5696 257.82959 263.70959 268.94159 272.6496 275.68561 281.91241 287.3844 290.42041 300.30841 306.4776 316.3656 320.62561 323.66159 327.9216 333.80161 339.0336 342.05759 345.0936 351.2616 355.5228 361.8588 368.4108 373.45081 377.71078 380.23199 383.26801 393.65039 398.65561 405.20761 408.24359 414.54361 419.6196 423.32761 426.36359 430.6236 436.5036 441.7356 444.75961 447.79559 457.68359 462.91559 469.46759 472.5036 475.5636 481.4808 484.0032"
         y="104.016"
         id="tspan178">For der skal skrives regninger ud, og alt det der med skat og moms skal ordnes. Men det skal man jo, </tspan><tspan

         y="130.02"
         id="tspan180">når man har et firma.</tspan></text>

         y="0"
         id="tspan188">Mange af Svends kunder er ældre mennesker. Da de var yngre, lavede de selv de små reparationer </tspan><tspan
         x="0 3.1919999 6.2280002 12.5532 19.033199 23.2932 28.3692 32.077202 34.5984 37.634399 46.394402 51.434399 54.470402 60.8064 66.038399 70.298401 74.558403 79.621201 85.922401 90.962402 93.998398 100.2264 105.768 110.028 115.26 118.296 122.556 127.6188 130.5264 136.01041 139.0464 145.34641 150.35159 154.6116 159.6516 163.91161 166.9476 173.3436 178.37399 183.66721 188.7072 191.2296 194.26559 204.15359 209.15759 215.70959 218.74561 225.0468 230.1216 233.82961 236.8656 243.2616 248.49361 252.8976 255.93359 262.2348 267.27481 270.31079 273.50281 279.38281 285.048 290.08801 293.12399 299.004 303.40799 311.25601 314.79599 318.39841 323.40359 327.80759 330.8436 334.58759 337.7796 340.80359 343.8396 353.7276 358.7316 362.99161 368.03159 370.55521 373.59119 379.30319 384.53519 387.5712 393.87241 398.91241 401.94839 406.95361 411.3576 414.39359 420.03241 423.0564 428.31119 434.6124 439.6524 442.68839 446.1936 452.3616 456.09479 458.61719 461.6532 466.88519 470.5932"
         y="26.004"
         id="tspan190">i huset. De passede også selv deres have, men det har de ikke kræfter til mere. Så de er glade for, at </tspan><tspan
         x="0 6.3011999 11.3412 14.3772 20.773199 26.005199 30.409201 33.445202 36.4692 44.3172 48.924 52.632 55.667999 61.142399 66.4356 71.440804 77.992798 84.328796 87.364799 92.596802 96.304802 99.340797 105.006 110.0112 116.5632 122.8632 127.9032 130.4268 133.4628 142.4772 147.7092 154.2612 157.2972 160.3212 165.3504 170.6436 175.6488 180.0528 183.08881 189.64079 194.64481 204.53281 207.55679 210.74879 216.22079 219.25681 224.3316 228.0396 231.07561 236.50079 242.73959 249.07561 252.7836 255.8196 260.07959 263.9436 269.3544 275.23441 280.8996 285.93961 288.97559 294.20761 298.75562 304.9704 310.15439 313.21439 319.5144 324.55441 327.07681 330.11279 336.11279 342.11279 348.11279 354.11279 360.11279 366.11279 372.11279 378.11279 384.11279 390.11279 396.11279 402.11279 408.11279 414.11279 420.11279 426.11279 428.63519 431.6712 437.38321 442.6152 445.65121 449.91119 455.7912 461.02319 464.04721 467.08319 473.3844 478.42441"
         y="52.007999"
         id="tspan192">de har lært Svend at kende. Han laver nemlig et godt stykke arbejde. ________________. Så skal de </tspan><tspan
         x="0 3.1919999 9.0719995 14.7384 19.7784 22.8144 28.2864 33.518398 36.554401 42.782398 48.254398 51.290401 56.583599 61.588799 68.1408 71.743202 76.783203 79.819199 83.0112 86.047203 92.527199 97.975197 103.0968 108.7596 111.9516 116.2116 118.734 121.77 127.8672 133.53 136.722 140.98199 144.01801 150.31799 155.3232 159.7272 162.7632 167.7684 172.17239 175.2084 180.28439 183.9924 187.0284 192.0912 195.174 198.198 203.2032 207.60719 210.6432 215.8752 222.4272 228.7272 233.802 237.50999 240.03239 243.06841 249.3696 254.3748 258.77881 261.81479 265.00681 270.88681 276.552 281.59201 284.62799 288.168 294.64801 301.20001 306.64801 311.6532 315.91321 320.9184 324.65161"
         y="78.012001"
         id="tspan194">ikke gå og vente i ugevis, hvis der er et eller andet, der ikke fungerer.</tspan></text>

         y="0"
         id="tspan126">Svend har mest at lave fra marts til oktober, for i den periode er der meget havearbejde. Om foråret </tspan><tspan
         x="0 6.1691999 10.4292 16.7652 23.3172 28.322399 32.726398 35.762402 42.158401 47.3904 53.942402 56.978401 60.483601 66.687599 69.711601 75.591599 79.851601 82.887604 89.2836 94.312798 99.606003 104.6112 109.0152 112.0512 118.278 123.75 126.786 133.12199 136.146 141.37801 147.92999 151.53239 156.5376 160.9416 163.9776 170.2536 175.4736 180.5136 183.54961 189.7068 192.7308 198.8988 208.7868 213.0468 216.6492 221.6544 225.3876 227.91 230.946 239.886 249.774 252.81 257.07001 263.23801 273.12601 283.01401 288.0192 292.27921 297.28439 303.8364 306.87241 312.75241 315.7764 318.96841 325.2684 331.66321 336.6684 341.07239 344.1084 350.50439 355.73639 362.28839 365.3244 371.7204 379.56839 385.44839 388.48441 394.7124 400.18439 403.2204 409.5564 414.78839 419.0484 423.30841 428.31241 432.7164 435.75241 441.90961 444.93359 451.10159 460.98959 465.2496 468.85199 473.85721 478.2612"
         y="26.004"
         id="tspan128">ordner han folks haver og planter nye blomster. Om sommeren klipper han hæk og passer blomster </tspan><tspan
         x="0 6.2280002 11.7 14.736 20.3388 24.7428 30.9468 37.498798 41.206799 45.466801 50.698799 56.146801 61.152 64.885201 67.4076 70.443604 76.155602 81.387604 84.423599 90.819603 96.051598 102.6036 105.6396 112.0356 117.2676 121.6716 124.7076 130.37041 133.56239 138.036 143.70239 148.7652 151.7892 154.9812 160.4532 163.4892 167.26801 171.76559 176.7948 182.3376 185.3616 189.0696 192.10561 195.29761 198.3336 204.6348 209.63879 216.1908 219.22681 225.6216 230.6268 235.16161 238.35361 244.5936 250.8936 255.93359 258.45599 261.492 270.3624 275.83441 278.87039 285.17041 290.2464 293.95441 296.99039 302.87039 308.10239 314.65439 317.6904 324.0864 329.31839 335.87039 338.9064 344.3316 350.5704 356.9064 360.61441 363.65039 366.67441 369.86639 376.1676 381.20761 383.73001 386.76599 392.76599 398.76599 404.76599 410.76599 416.76599 422.76599 428.76599 434.76599 440.76599 446.76599 452.76599 458.76599 464.76599 470.76599 476.76599 482.76599 485.28839"
         y="52.007999"
         id="tspan130">og grøntsager. Så han har virkelig travlt i den periode. Og det kan han godt lide. ________________. </tspan><tspan
         x="0 10.3824 15.3864 21.9384 24.9744 31.370399 36.602402 43.1544 46.190399 51.195599 55.599602 58.635601 64.862396 70.405197 74.665199 79.897202 82.933197 88.573196 91.597198 96.851997 103.188 106.224 109.7292 115.8972 119.6304 122.1528 125.1888 130.42081 134.1288 137.16479 143.56081 148.7928 155.3448 158.3808 164.77679 170.0088 174.4128 177.44881 187.33681 190.52879 197.0808 203.41679 207.6768 212.7168 215.75281 219.5316 224.02921 229.0584 234.6012 237.6252 241.33321 244.3692 247.90919 252.4068 257.63879 260.6748 267.22681 273.2988 278.59201 283.5972 293.4852 299.70001 304.7052 309.10919 312.1452 315.888 319.07999 322.104 325.14001 328.64401 333.70801 339.85199 344.33881 350.81879 356.05081 359.78281 362.3064 365.34241 369.60239 374.83441 377.87039 384.26639 389.49841 396.05042 399.0864 404.9664 410.19839 416.7504 419.78641 424.04639 427.0704 432.3024 438.60239 444.99719 450.0372 453.07321 456.0972 459.28922 465.62521 469.33319 472.3692 477.6012 481.49881"
         y="78.012001"
         id="tspan132">Men han er også glad for, at han har mindre travlt fra november til februar, så han kan slappe lidt af </tspan><tspan
         x="0 3.1919999 9.7440004 16.08 19.271999 29.16 34.222801 37.305599 40.329601 45.334801 55.222801 57.745201 60.7812 69.721199 79.6092 82.645203 87.661201 91.201202 94.803596 99.8088 104.2128 109.4448 113.7048 118.7796 122.4876 125.5236 130.52879 134.9328 137.9688 144.2688 149.274 153.67799 156.714 159.90601 165.354 170.35921 176.91119 179.9472 186.3432 194.19119 200.0712 205.7364 210.7764 213.2988 216.33479 222.636 227.6412 232.0452 235.08121 239.3412 245.22121 250.4532 253.4772 256.51321 262.39319 265.41721 268.60919 274.9104 281.30521 286.34521 290.60519 293.12759 296.1636 301.2276 304.31039 307.33441 312.33841 316.7424 319.77841 323.556 327.95999 335.80801 340.8132 344.5452 347.0676 350.10361 356.40479 361.41 365.814 368.85001 373.10999 378.98999 384.22198 387.246 390.28201 396.49799 401.53799 405.798 411.67801 419.526 423.78601 428.82599 433.086 435.6084"
         y="104.016"
         id="tspan134">indimellem. Om efteråret er der igen hække, der skal klippes, eller træer, der skal beskæres. </tspan></text>

         y="0"
         id="tspan142">Vinterhalvåret er nemlig en mere stille periode, fordi der ikke er noget havearbejde. Men han får </tspan><tspan
         x="0 3.54 6.5640001 11.5692 15.8292 20.8692 23.905199 30.132 35.604 38.639999 42.18 45.203999 50.209202 54.4692 59.509201 62.5452 68.425201 74.905197 81.457199 87.7584 92.762398 96.495598 99.017998 102.054 108.3552 113.3604 117.7644 120.8004 125.0604 130.9404 136.17239 139.1964 142.23241 148.6284 153.6588 158.952 163.992 167.028 170.052 175.08121 180.3744 185.45039 189.1584 192.1944 198.7464 204.97321 210.4212 215.49719 219.2052 222.2412 227.53439 232.5972 238.9332 241.96919 248.2704 253.2756 257.53561 262.57559 266.8356 269.87161 276.19681 282.67679 286.9368 289.4592 292.49521 301.50839 306.74039 313.29239 316.3284 319.86841 325.1004 329.50439 332.54041 338.7684 344.31 348.57001 353.802 356.83801 362.71799 369.198 375.75 382.05121 387.05521 391.4592 394.49521 397.5192 405.36719 411.91919 417.36719 422.37241 426.63239 431.67239 434.7084 440.9364 446.40839"
         y="26.004"
         id="tspan144">flere og flere kunder, der skal have lavet noget ved deres hus. Han får også kunder længere og </tspan><tspan
         x="0 3.0239999 10.872 17.424 22.872 27.877199 32.137199 37.1772 40.2132 45.697201 53.5452 59.425201 62.461201 66.001198 70.498802 75.730797 78.253197 81.2892 87.386398 92.667603 98.8368 103.2408 106.2768 112.6728 117.9048 124.4568 127.4928 133.7076 139.8756 143.6088 146.1312 149.16721 157.9272 163.002 166.71001 169.746 175.35001 178.42439 183.71761 188.72279 193.1268 196.1628 201.168 207.72 210.756 217.056 222.12 225.144 228.17999 234.06 240.26401 244.644 248.90401 253.968 256.992 259.5144 262.55042 268.55042 274.55042 280.55042 286.55042 292.55042 298.55042 304.55042 310.55042 316.55042 322.55042 328.55042 334.55042 340.55042 346.55042 352.55042 358.55042 361.07281 364.1088 370.07401 376.24319 380.64719 383.6832 390.07919 395.31119 401.86319 404.8992 410.5416 416.71078 426.59879 436.48679 441.49081 445.89481 448.93079 453.41641 459.89639 466.44839 472.78439 476.4924"
         y="52.007999"
         id="tspan146">længere væk fra, hvor han bor. Det giver en del kørsel. ________________. For han kommer rundt </tspan><tspan
         x="0 3.1919999 6.2280002 9.2519999 14.484 21.035999 27.336 32.411999 36.119999 39.155998 45.382801 50.854801 53.8908 58.150799 63.155998 67.559998 70.596001 80.484001 85.716003 92.267998 97.716003 102.756 105.792 109.296 115.4652 119.8464 124.1064 129.77161 134.8356 137.91721 140.94119 144.13319 149.5824 154.62241 157.6584 161.9184 165.5208 170.5836 176.8848 181.89 186.29401 189.33 195.55679 201.02879 204.0648 213.9528 220.1568 226.45799 231.46201 235.866 238.90199 245.1792 250.3992 255.43919 258.47519 268.36319 273.36719 279.91919 286.47119 291.5112 295.77121 301.43759 306.44281 310.1748 312.6972 315.73318 321.44519 326.67719 329.7132 336.10919 341.34119 347.89319 350.9292 355.18921 358.3812 363.82919 368.83441 373.2384 376.27441 381.50641 384.5304 390.86639 395.4024 398.59439 404.06641 407.10239 413.65439 418.83841 421.82761 424.35001 427.38599 433.48318 439.146 442.33801 446.59799 449.634 456.03 461.26199 467.814"
         y="78.012001"
         id="tspan148">i landet og ser mange forskellige steder og møder nye mennesker. Så han siger aldrig nej, hvis han </tspan><tspan
         x="0 5.0640001 8.1456003 11.1696 16.174801 20.5548 24.8148 27.8508 31.629601 35.866798 42.034801 45.768002 48.290401 51.326401 57.627602 62.7024 66.4104 69.446404 74.451599 78.855598 81.891602 86.895599 93.447601 96.483597 102.6288 109.0116 114.5424 119.5728 124.866 129.90601 132.42841 135.4644 141.8604 147.09241 153.64439 156.6804 162.56039 167.7924 174.34441 177.3804 183.26041 186.28439 191.5164 195.7764 200.81641"
         y="104.016"
         id="tspan150">ellers tror, det er en opgave, han kan klare.</tspan></text>

       id="text168"><tspan
         x="0 5.4744 10.7676 15.7728 22.3248 28.660801 31.6968 35.956799 40.962002 45.366001 48.402 58.290001 63.375599 68.824799 73.899597 77.607597 80.6436 83.632797 88.9608 93.220802 96.928802 99.964798 106.3008 111.5328 114.5688 118.1088 122.3688 127.374 137.26199 141.00481 144.19679 150.498 155.5032 162.05521 165.0912 169.3512 175.5192 185.4072 188.44321 194.77921 197.97121 202.2312 207.27119 213.1512 216.85921 223.0632 226.7964 229.3188 232.3548 238.75079 243.9828 250.53481 256.776 262.26001 270.108 274.58279 280.24799 285.2532 289.6572 292.69321 298.9212 304.39319 307.4292 312.95999 318.19199 322.79761 326.57639 333.12839 338.13361 342.5376 345.57361 348.76559 351.80161 356.06161 359.2536 362.96161 365.99759 371.08441 376.5336 381.6084 385.31641 388.35239 391.3764 394.56839 397.64999 400.67401 405.71399 408.75 413.75519 420.30719 430.19519 435.42719 441.97919 448.31519 452.5752 456.1152 459.30719 463.79279 473.68079 478.91281 481.43521"
         y="0"
         id="tspan158">Svend ser meget lyst på fremtiden som direktør, håndværker og gartner i sit eget lille enmandsfirma. </tspan><tspan
         x="0 9.0131998 14.2452 20.797199 23.8332 28.093201 33.457199 40.009201 45.049198 49.3092 51.8316 54.867599 61.263599 66.495598 73.0476 76.083603 82.479599 87.711601 92.115601 95.151604 98.691597 103.9236 108.9996 112.7076 115.7436 120.8196 124.5276 127.5636 130.5876 135.8196 142.3716 147.8436 151.55161 154.5876 160.8036 165.86639 172.20239 176.4624 181.5024 184.53841 187.56239 190.638 195.5004 198.0228 201.05881 206.064 212.616 218.952 221.98801 228.384 233.616 240.168 243.20399 249.60001 254.6304 259.94641 266.24759 271.2876 274.32361 277.86359 284.0676 287.80081 290.32321 293.35919 299.32559 305.49359 309.89761 312.93359 317.9736 323.85361 328.11359 333.1188 343.00681 349.40039 354.46439 357.4884 360.52441 366.40439 371.63641 378.18839 381.2244 387.62039 392.85239 399.40439 402.4404 406.18439 409.3764 412.40039 422.28839 427.3512 430.37521 436.67639 441.7164 444.75241 449.01239 452.20441 457.67639 460.7124 465.78839 469.4964"
         y="26.004"
         id="tspan160">Han synes, han har fået et langt bedre liv, end han havde før. For eksempel kan han tilmelde sig et </tspan><tspan
         x="0 5.8800001 12.36 16.74 20.9652 27.4452 31.7052 34.741199 41.077202 46.3092 49.3452 52.947601 57.987598 63.867599 70.419601 73.611603 77.871597 83.751602 86.787598 91.0476 96.690002 102.894 105.918 110.958 113.4816 116.5176 122.6148 128.2776 131.4696 135.7296 138.76559 145.16161 150.3936 156.9456 159.9816 163.52161 166.71359 173.26559 179.5656 184.5708 188.97479 192.0108 197.0856 200.79359 203.82961 208.3656 211.5576 217.0296 220.7724 223.9644 229.4364 232.4724 237.8976 244.1364 250.4724 254.1804 257.2164 262.2912 265.99921 268.52161 271.55759 280.42679 285.8988 288.93481 295.23599 300.24121 304.6452 307.68121 312.68521 317.0892 320.12521 324.38519 328.0932 333.34921 339.68521 342.8772 348.34921 351.38519 355.12921 358.3212 364.8732 370.48801 373.01041 376.04639 382.44241 387.67441 394.22641 397.26239 403.65839 408.89041 413.2944 416.33041 422.47559 426.96121 433.44119 438.91321 441.94919 445.45441 451.6236 456.02759 459.0636 464.29559 468.0036"
         y="52.007999"
         id="tspan162">kursus på teknisk skole, hvis han finder et rigtig godt et. Og der er stadig ting, han har brug for at </tspan><tspan
         x="0 3.0239999 10.872 15.132 20.172001 22.694401 25.7304 31.6968 37.866001 42.27 45.306 50.346001 56.226002 60.486 65.489998 75.377998 81.772797 86.835602 89.859596 92.895599 98.558403 101.7504 104.7744 107.8104 114.2064 119.4384 125.9904 129.0264 134.4744 139.4796 143.96519 150.5172 155.55721 158.5932 161.6172 169.46519 173.7252 178.7652 181.80119 187.0332 190.7412 193.77721 196.80119 201.8316 207.1248 212.16479 215.20081 218.7408 221.9328 228.4848 233.5248 236.56081 242.03281 248.5128 251.42039 256.71359 261.7536 264.78961 270.02161 273.918 276.95401 280.7316 285.13559 292.98361 295.50601 298.54199 304.54199 310.54199 316.54199 322.54199 328.54199 334.54199 340.54199 346.54199 352.54199 358.54199 364.54199 370.54199 376.54199 382.54199 388.54199 394.54199 397.06439 400.1004 406.79639 412.02841 415.06439 421.3656 426.3696 432.9216 435.95761 445.84561 451.07761 457.37881 462.41879 465.4548 471.33481 476.5668 483.1188"
         y="78.012001"
         id="tspan164">lære. For eksempel vil han gerne lære at lave fine gulve af træ. ________________. På den måde kan </tspan><tspan
         x="0 6.3959999 11.628 18.18 21.216 27.442801 32.9856 37.245602 42.4776 45.513599 51.669601 54.6936 57.768002 63.061199 68.101196 71.137199 76.611603 81.9048 86.910004 93.461998 99.797997 102.3204 105.3564 111.6564 116.6616 121.0656 124.1016 130.2708 134.53081 140.86681 147.41879 152.42281 156.8268"
         y="104.016"
         id="tspan166">han også blive Svend, der ordner </tspan></text>

       id="text120"><tspan
         x="0 8.7600002 13.8348 17.542801 20.5788 26.458799 31.6908 38.242802 41.278801 44.338799 49.4244 54.8964 57.9324 62.192402 67.6884 72.920403 77.180397 82.220398 85.256401 95.144402 100.2312 105.6804 110.7552 114.4632 117.4992 123.7992 128.2032 136.05119 141.05521 144.24719 148.5072 152.21519 155.25121 161.5872 166.8192 169.3416 172.37759 175.8828 182.0508 186.4548 189.4908 192.6828 195.7188 202.2708 210.1188 214.3788 217.9812 223.02119"
         y="0"
         id="tspan98">Det kan jeg svare meget præcist på, for i næste </tspan><tspan
         x="0 9.8879995 15.12 21.672001 26.7348 33.070801 36.1068 41.112 45.515999 48.551998 54.852001 59.928001 63.636002 66.671997 73.223999 78.227997 88.115997 91.139999 94.332001 99.804001 102.84 107.9148 111.6228 114.6588 119.8908 124.2948 127.3308 131.59081 134.78281 141.084 146.088 152.64 155.1624 158.19839 161.25841 166.3452 171.8172 174.8532 179.1132 182.8212 188.05321 192.6588 196.2612 201.3252 207.6252 212.66521 215.7012 222.0972 227.1012 231.5052"
         y="15.996"
         id="tspan100">måned er det nemlig et år siden, jeg startede her </tspan><tspan
         x="0 6.336 11.568 14.604 20.784 26.988001 31.4736 38.0256 43.065601 48.2976 51.802799 58.102798 63.166801 66.190804 69.382797 75.934799 81.382797 86.388 92.940002 95.462402 98.498398 102.1704 107.2572 112.7292 115.7652 121.9224 124.9464 130.06799 135.552 138.588 142.12801 149.976 154.23599 160.57201 163.76401 169.23599 172.272 182.16 187.22279 193.55881 196.5948 206.4828 209.6748 216.22681"
         y="31.992001"
         id="tspan102">på børneafdelingen. Jeg blev færdig med min </tspan><tspan
         x="0 6.48 12.816 19.152 24.384001 30.936001 37.487999 42.5508 45.574799 49.834801 54.874802 57.910801 61.102798 64.138802 67.152 73.632004 80.183998 83.375999 86.412003 90.671997 93.863998 100.2 104.46 108.0612 113.1012 116.1372 121.3692 125.1024 127.6248 130.6608 136.88879 142.36079 145.3968 149.6568 154.88879 157.9248 161.4648 164.6568 170.5368 173.5728 176.6328 181.7196 187.1916 190.2276 193.2876 199.4796 205.65961 208.6956 212.9556 219.1248 229.0128"
         y="47.987999"
         id="tspan104">uddannelse i juni sidste år, og så fik jeg job som </tspan><tspan
         x="0 4.2600002 9.6000004 15.0492 20.0772 26.4132 29.437201 34.621201 37.681198 42.6852 47.065201 51.325199 56.9916 62.031601 65.067596 71.4636 76.468803 80.872803 83.908798 86.9328 90.124802 95.5728 100.6128 103.6488 108.6648 112.2048 115.8072 120.8124 124.5456 127.068"
         y="63.984001"
         id="tspan106">sygeplejerske her lige efter. </tspan><tspan
         x="272.12399 275.84641 281.0784 283.6008 286.63681 292.93799 298.01279 301.72079 304.75681 309.76199 314.16599 317.202 320.26199 325.34879 330.8208 333.85681 340.25281 345.3168 348.34079 352.0488 355.08481 359.34479 362.5368 368.41681 374.082 379.08719 383.49121 386.52719 392.86319 398.09521 400.61761 403.65359 407.32559 412.41241 417.8844 420.92041 425.98441 429.00839 433.2684 438.93481 443.93881 448.3428 451.37881 457.55881 463.76279 468.24841 474.80042 478.02841 481.06439 491.44681 496.452 503.004"
         y="-0.012"
         id="tspan108">Ja, det er jeg helt sikker på. Jeg elsker børn! Men </tspan><tspan
         x="272.12399 275.14801 278.34 283.78799 288.828 291.86401 298.33441 304.81439 307.8504 312.8544 317.25839 320.2944 326.59439 331.67041 335.37839 338.4144 344.07721 347.2692 352.74121 356.48401 359.67599 365.14801 368.85599 371.892 375.39719 381.56519 385.96921 389.00519 398.89319 402.08521 407.55719 410.5932 415.8252 419.5332 422.56921 426.10919 431.34119 434.3772 440.9292 447.15601 452.604 457.67999 461.388 464.42401 474.31201 479.31601 483.57721 488.61719"
         y="15.984"
         id="tspan110">lige nu er det vigtigt for mig at få noget mere </tspan><tspan
         x="272.12399 277.12921 281.59079 285.1308 290.36279 294.8988 298.09079 304.64279 310.11481 313.15079 317.4108 323.5788 333.4668 336.50281 340.76279 346.104 351.552 356.57999 362.91599 365.94 371.12399 374.18399 379.18921 383.56921 387.82919 393.49561 398.53561 401.05801 404.09399 412.85281 417.9288 421.63681 424.67279 429.67679 434.08081 437.11679 440.17679 446.3808 449.41681 455.29681 461.77679 468.3288 471.36481 476.43961 480.14761 483.18359 488.41559 492.81961"
         y="31.98"
         id="tspan112">erfaring som sygeplejerske. Det er jo kun et år </tspan><tspan
         x="272.12399 276.384 279.57599 285.8772 290.8812 297.4332 299.9556 302.99161 306.05161 311.1384 316.61041 319.64639 325.80359 328.82761 333.94919 339.4332 342.46921 346.00919 353.85721 358.11719 364.45319 367.6452 373.11719 376.1532 386.0412 391.104 397.44 400.47601 410.36401 413.556 420.108 423.14401 429.62399 435.95999 442.29599 447.52802 454.07999 460.63199 465.69479 468.71881 472.97879 478.0188 480.5412 483.57721 489.80521 495.27719"
         y="47.976002"
         id="tspan114">siden, jeg blev færdig med min uddannelse, og </tspan><tspan
         x="272.12399 275.18399 280.27081 285.7428 288.77881 295.1748 300.4068 304.81079 307.8468 312.10681 315.81479 321.06961 327.40561 330.5976 336.06961 339.10559 348.99359 354.08041 359.52841 364.60321 368.31119 371.3472 376.57919 380.2872 383.32321 386.3472 394.19519 398.4552 403.49521 406.01761 409.05359 414.76559 419.99759 423.0336 426.0936 431.18039 436.6524 439.68839 444.9816 449.98679 456.53879 460.1412 465.14639 469.55042 472.5864 479.1384 485.34241 491.22241"
         y="63.972"
         id="tspan116">jeg har stadig meget at lære. Så jeg venter nok </tspan><tspan
         x="272.12399 275.14801 278.34 283.78799 288.828 291.86401 296.94 300.64801 303.68399 310.01999 315.25201 319.65601 322.69199 327.92401 332.328 335.36401 345.25201 350.31601 356.65201 359.68799 364.92001 368.62799 371.664 377.8212 380.84521 383.91959 389.2128 394.25281 397.28879 407.17679 413.34601 417.07919 419.60159"
         y="79.968002"
         id="tspan118">lige et par år med at blive mor. </tspan></text>

    <text

       transform="matrix(1,0,0,-1,79.37,489.9528)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:12px;font-family:Minion;-inkscape-font-specification:Minion-Regular;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text150"><tspan
         x="0 8.7600002 13.8348 17.542801 20.5728 23.560801 28.782 35.082001 40.0872 44.491199 47.521198 57.409199 62.641201 66.901199 72.566399 77.6064 80.636398 83.6604 86.852402 93.1884 96.8964 99.925201 109.8132 117.6612 122.136 127.8012 132.8652 135.88921 139.08121 144.55321 148.2612 150.7836 153.81239 163.70039 168.7056 175.2576 178.28641 181.34641 186.4332 191.9052 194.9352 200.16721 204.714 210.92999 216.11279 219.17281 225.474 230.4792 234.88319 238.11121"
         y="0"
         id="tspan126">Det lyder måske lidt mærkeligt, men jeg arbejder! </tspan><tspan
         x="0 10.3824 15.3864 21.9384 26.1984 29.2344 32.294399 37.381199 42.853199 45.889198 50.1492 53.8452 60.325199 66.626404 71.630402 75.891602 80.954399 87.2556 92.295601 94.818001 97.853996 103.086 107.6328 113.8488 119.0316 122.0916 128.39281 133.4556 139.75681 144.7968 147.83279 150.89281 155.9796 161.4516 164.48759 170.71561 176.2572 180.5172 185.74921 188.7852 192.3252 196.86121 199.93559 205.5984 208.79041 211.87199 214.896 218.088 223.56 227.26801"
         y="15.996"
         id="tspan128">Mens jeg studerede, arbejdede jeg også frivilligt </tspan><tspan
         x="0 6.2160001 11.328 14.244 19.128 25.559999 28.476 33.360001 38.472 41.891998 46.812 49.728001 53.112 59.161201 63.445202 66.361198 76.129204 81.013199 87.445198 93.877197 98.797203 102.9372 108.4824 113.3676 117.6516 120.5676 130.3356 135.2784 141.4944 144.4104 150.6264 154.7664 160.05721 165.8172 168.88921 173.02921 178.57561 183.49561 186.41161 192.5928 196.7088 202.78081 208.81799 211.722 216.606 226.37399 231.2592 234.87241 237.39481"
         y="31.992001"
         id="tspan130">på en café for mennesker med psykiske problemer. </tspan><tspan
         x="0 8.8691998 14.3412 17.377199 23.6784 28.753201 32.461201 35.4972 40.9692 47.173199 51.577202 54.613201 57.673199 62.759998 68.232002 71.267998 75.528 79.236 84.490799 90.826797 94.018799 99.490799 102.5268 107.6016 111.3096 114.3456 120.6816 125.9136 130.3176 133.35361 137.09641 140.28841 150.17641 155.18159 159.5856 162.6216 168.7188 174.01199 179.01601 183.42 186.45599 191.688 198.24001 204.5412 209.5452 216.0972"
         y="47.987999"
         id="tspan132">Og det gør jeg stadig et par timer hver anden </tspan><tspan
         x="0 6.48 11.928 16.968 19.4904 22.5264 32.908798 37.914001 44.466 47.501999 52.5648 55.647598 58.6716 63.6768 68.056801 72.316803 75.352798 79.612801 82.636803 87.868797 94.1688 100.5636 105.5688 109.9728 113.0088 116.0688 121.1556 126.6276 129.6636 135.8436 141.07561 145.3356 150.3756 153.41161 158.6436 162.5412 165.57719 171.8772 176.8824 181.35719 187.7532 190.8132 195.8172 205.7052 215.5932 220.63319"
         y="63.984001"
         id="tspan134">uge. Men ellers slapper jeg bare af derhjemme </tspan><tspan
         x="0 5.0640001 8.1456003 11.1696 16.174801 20.5788 23.614799 29.0868 34.318802 38.722801 41.758801 44.950802 47.986801 54.130798 57.3228 63.5508 69.1548 73.652397 78.884399 82.388397 87.3936 93.945602 96.981598 103.2084 108.6804 111.7164 118.0524 123.2844 126.3204 131.3244 136.5564 140.09641 145.1364 148.17239 154.3992 159.8712 162.9072 167.16721 172.3992 178.7352 183.96719 190.5192 193.55521 200.10719 206.33521 211.7832 216.858 220.56599"
         y="79.980003"
         id="tspan136">eller går i biografen og på café og sådan noget.</tspan><tspan
         x="272.12399 280.884 285.92401 288.95999 292.5 295.52399 300.564 304.82401 308.42639 313.4664 316.50241 322.6824 328.88641 333.37201 339.92401 342.95999 349.35599 354.58801 358.992 362.02802 367.68961 370.88159 375.1416 378.84961 381.88559 391.77359 397.00562 403.55759 409.00562 414.04559 417.0816 420.58679 426.75479 431.13599 435.396 441.06241 446.12521 449.20801 452.23199 455.42401 460.87201 465.91199 468.948 475.284 479.68799 485.892 495.78"
         y="-0.024"
         id="tspan138">De fleste børn har vist mange forskellige drøm-</tspan><tspan
         x="272.12399 282.01199 287.052 290.08801 296.31479 301.7868 304.82281 311.15881 314.1828 319.41479 325.9668 330.97198 334.7052 337.2276 340.26361 346.49039 351.9624 354.99841 361.29959 366.37439 370.0824 373.11841 379.5144 384.5448 389.86081 396.16199 401.202 404.23801 407.298 412.3848 417.85681 420.89279 427.1196 432.66241 436.92239 442.15439 444.67679 447.7128 451.3848 456.47159 461.9436 464.97961 470.6424 473.83441 476.91721 479.94119 484.9812"
         y="15.972"
         id="tspan140">me og planer, og det havde jeg også. Jeg ville </tspan><tspan
         x="272.12399 277.57199 282.57721 287.06281 293.61481 298.65479 301.6908 307.1748 315.0228 319.28281 324.32281 327.3588 330.38281 338.2308 343.67999 348.72 351.2424 354.27841 364.16641 369.17041 375.72241 378.75839 381.81839 386.90521 392.3772 395.41321 401.07599 404.26801 407.3508 410.37479 415.41479 418.45081 424.67761 430.2204 434.48041 439.7124 442.74841 448.19641 453.2016 457.68719 464.2392 469.27921 472.31519 477.79919 485.64719 489.9072 494.9472"
         y="31.968"
         id="tspan142">gerne være læge, men jeg ville også gerne være </tspan><tspan
         x="272.12399 275.664 280.20001 283.392 287.65201 293.85599 297.58801 300.1116 303.14761 312.01682 317.4888 320.52481 326.8956 333.0408 339.3768 343.63681 348.8688 355.42081 360.8688 365.87399 369.60721 372.12961 375.16559 378.9444 383.18039 389.34961 393.7536 396.78961 399.84961 404.9364 410.55121 413.07361 416.10959 426.492 431.49719 438.04919 441.08521 447.38519 452.46121 456.16919 459.2052 464.70001 469.93201 474.336 477.37201 480.91199 487.116 491.496 495.75601 499.46399 501.98639"
         y="47.964001"
         id="tspan144">frisør. Og popsanger, tror jeg. Men det var først, </tspan><tspan
         x="272.12399 278.45999 283.69199 286.728 289.78799 294.87479 300.3468 303.38281 308.87881 314.11081 318.5148 321.55081 325.09079 332.93881 337.20001 343.53601 346.728 352.20001 355.23599 365.12399 370.18799 376.52399 379.56 385.2576 390.78839 400.67639 407.22839 412.46039 416.7204 419.91241 424.98721 428.69519 431.21759 434.2536 437.3136 442.3992 447.87119 450.9072 457.1232 462.16321 466.42319 469.3884 475.83359 479.5416 483.14279 488.20679 494.508 499.548 502.0704"
         y="63.959999"
         id="tspan146">da jeg var færdig med gymnasiet, jeg besluttede, </tspan><tspan
         x="272.12399 277.35599 281.064 284.10001 287.16 292.2468 297.71881 300.75479 306.4176 309.60959 312.69119 315.71521 320.75519 323.7912 328.05121 334.25519 339.70441 344.74438 347.7804 350.97241 357.52441 363.86041 366.89639 373.23239 378.46439 381.5004 385.76041 391.10159 396.54959 401.57761 407.9136 410.93759 416.12161 419.18161 424.22159 428.4816 434.12399 440.328 443.35199 448.35599 454.90799 457.43161"
         y="79.956001"
         id="tspan148">at jeg ville søge ind på sygeplejeskolen. </tspan></text>

    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,79.37,344.5315)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:12px;font-family:Minion;-inkscape-font-specification:Minion-Regular;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text182"><tspan
         x="0 7.7052002 10.7292 14.4372 18.697201 23.929199 26.450399 29.486401 32.510399 35.7024 41.1516 46.191601 49.2276 55.6968 62.1768 65.212799 70.875603 74.067596 77.091599 80.127602 83.187599 88.274399 93.746399 96.782402 101.0424 106.5372 111.7692 116.0304 121.0704 124.1064 127.212 132.444 134.9664 138.0024 144.39841 149.4624 152.4864 156.1944 159.23039 163.4904 166.6824 172.56239 178.2276 183.2328 187.83839 191.5464 194.0688 197.1048 200.61 206.77921 211.1832 214.21919 217.27921 222.36481 227.83681"
         y="0"
         id="tspan156">Altså, lige nu vil jeg svare ja, helt sikkert, for jeg </tspan><tspan
         x="0 5.0051999 9.4091997 12.4452 16.7052 21.937201 24.9732 30.613199 33.637199 38.891998 45.228001 48.264 51.769199 57.937199 62.341202 65.377197 70.6092 74.3172 77.353203 82.837196 90.685204 94.945198 99.985199 103.0212 109.4172 114.4224 118.1556 120.678 123.714 129.9408 135.4128 138.44881 148.33681 151.52879 158.0808 163.1208 166.1568 171.79919 178.0032 181.086 184.11 189.19679 194.64481 199.64999 204.054 207.09 212.09399 216.498"
         y="15.996"
         id="tspan158">er så glad for at være her, og mine kolleger er </tspan><tspan
         x="0 4.5359998 7.7280002 13.2 16.942801 20.1348 25.6068 28.642799 32.902802 39.1068 45.406799 50.4468 52.9692 56.005199 66.387604 71.392799 77.944801 80.980797 90.868797 96.1008 100.3608 106.026 111.066 114.102 118.362 124.242 127.434 130.974 134.5764 139.5804 143.98441 147.0204 150.0804 155.16721 160.63921 163.6752 173.5632 178.56841 185.12041 188.31239 194.8644 200.3364 203.37241 209.54041 219.42841 222.4644 227.5392 231.24719"
         y="31.992001"
         id="tspan160">rigtig søde. Men måske skifter jeg mening om et </tspan><tspan
         x="0 6.336 11.568 15.972 19.007999 24.24 27.9732 30.4956 33.531601 40.083599 45.315601 49.719601 52.7556 55.815601 60.902401 66.374397 69.4104 73.670403 78.734398 81.6408 87.124802 90.160797 93.700798 98.9328 103.3368 106.3728 112.5528 118.7568 123.2424 129.7944 132.3168 135.3528 144.3192 149.3244 153.72839 156.7644 161.0244 166.9044 172.1364 175.1604 178.1964 183.85921 187.05119 190.0872 196.63921 201.64439 211.53239 214.5564 217.7484 223.2204"
         y="47.987999"
         id="tspan162">par år, når jeg selv får børn. Her skal vi nemlig </tspan><tspan
         x="0 5.2319999 8.3148003 11.3388 16.378799 19.414801 23.674801 28.906799 38.7948 48.6828 53.686798 60.2388 63.274799 69.670799 74.699997 79.993202 85.033203 88.069199 94.621201 99.853203 103.5612 107.1636 112.2864 117.7812 123.0132 128.4852 132.19321 135.2292 139.4892 145.6572 155.5452 165.4332 170.47321 173.5092 177.2532 180.44521 186.74519 191.7504 195.4836 198.006 201.04201 207.2688 212.7408 215.77679 222.3288 227.56081 231.2688"
         y="63.984001"
         id="tspan164">alle sammen have nattevagt somme tider, og nat-</tspan><tspan
         x="0 3.6024001 8.724 14.22 19.452 24.924 28.5264 33.530399 37.934399 40.970402 47.3064 52.538399 56.798401 61.058399 66.063599 70.467598 73.503601 76.695602 82.5756 88.240799 93.2808 96.316803 100.5768 105.8088 108.8448 114.27 120.5088 126.8448 130.5528 133.58881 137.33279 140.5248 143.5488 146.58479 151.6608 155.3688 158.4048 161.94479 167.1768 177.0648 180.25681 183.28081 186.47279 191.5356 194.5596 197.634 202.4964 205.0188"
         y="79.980003"
         id="tspan166">tevagter passer ikke så godt til et familieliv. </tspan><tspan
         x="272.12399 280.884 285.9588 289.66681 292.70279 296.48041 300.71759 306.88681 311.2908 314.32681 317.38681 322.4736 328.08841 330.61081 333.64679 339.948 344.98801 348.02399 351.564 354.58801 359.62799 363.888 367.49039 372.5304 375.56641 379.82639 385.16641 390.6156 395.64359 401.97961 405.0036 410.1864 413.2464 418.25159 422.63281 426.89279 432.55801 437.5632 441.96719 445.0032 449.26321 454.6272 461.1792 466.21921 470.47919 473.0004 476.03641 479.5416 485.71078 490.11481"
         y="-0.024"
         id="tspan168">Det tror jeg, de fleste sygeplejersker synes, for </tspan><tspan
         x="272.12399 277.7868 280.97879 284.0148 290.4108 295.64279 300.04681 303.08279 312.97079 318.05759 323.50681 328.5816 332.28961 335.32559 339.10321 343.60199 348.6312 354.17401 357.198 360.90601 363.94199 370.03799 375.3324 380.3364 384.74039 387.7764 394.1124 399.34439 404.96039 407.48279 410.5188 416.74561 422.21759 425.2536 430.91641 434.1084 437.14441 443.54041 448.7724 453.17639 456.2124 461.2872 464.99521 468.03119 472.2912 475.88159 482.05081 486.6564 490.36441"
         y="15.972"
         id="tspan170">vi har meget travlt hver dag, og vi har et stort </tspan><tspan
         x="272.12399 277.35599 283.90799 288.168 293.66281 298.89481 302.62799 305.15039 308.1864 313.89841 319.1304 322.16641 325.27319 330.50519 333.02759 336.0636 342.36481 347.43961 351.14761 354.18359 359.18881 363.5928 366.62881 372.9288 378.00479 381.7128 384.2352 387.27121 393.49921 398.97119 402.0072 405.0672 410.15399 415.62601 418.66199 424.54199 429.77399 436.32599 439.362 444.78601 451.026 457.362 461.07001 464.10599 469.59 477.43799 481.698 486.73801"
         y="31.968"
         id="tspan172">ansvar. Så ja, det er det, og jeg kan godt være </tspan><tspan
         x="272.12399 282.01199 287.09879 292.54681 297.6228 301.33081 304.36679 308.14441 312.5484 320.39639 324.1044 327.14041 333.36719 338.8392 341.87521 348.27121 353.30161 358.59479 363.6348 366.67081 372.83881 379.39081 385.72681 389.43481 392.47079 395.66281 398.69879 405.09479 411.16681 416.45999 421.52399 427.8252 432.89999 436.608 439.64401 444.66 448.20001 451.8024 456.80759 461.21161 464.24759 469.25159 475.80359 478.8396 481.86359 487.09561 493.64761 499.1196"
         y="47.964001"
         id="tspan174">meget træt og have ondt i hovedet efter en lang </tspan><tspan
         x="272.12399 278.45999 283.69199 289.30801 291.83041 294.86639 305.24759 310.25281 316.80481 319.84079 326.23679 331.29959 334.32361 340.65961 343.85159 349.32361 354.98639 358.17841 362.43839 365.4744 370.47839 374.88239 377.9184 384.2196 389.22479 393.62881 396.66479 402.8916 408.43439 412.6944 417.92639 420.9624 430.8504 436.0824 442.6344 448.0824 453.12241 456.15839 462.52921 468.73318 472.99319 476.18521 479.92801 483.00241 488.29559 493.3356"
         y="63.959999"
         id="tspan176">dag. Men heldigvis er der også mange positive </tspan><tspan
         x="272.12399 275.86679 279.05881 285.61081 291.08279 294.1188 299.41199 304.47601 310.81201 313.84799 316.90799 323.10001 329.23318 335.448 340.5228 344.2308 346.7532 349.78922 356.09039 361.09561 365.4996 368.53561 374.0076 380.21161 383.9436 386.466 389.50201 394.73401 398.44199 401.478 411.366 416.59799 423.14999 426.186 431.418 434.50079 437.52481 440.7168 446.16479 451.28641 456.57959 461.64359 464.6676 467.70361 473.58359 478.81561 485.36761"
         y="79.956001"
         id="tspan178">ting ved jobbet, der gør, at man alligevel kan </tspan><tspan
         x="272.12399 278.004 281.02802 286.26001 290.51999 295.56 298.59601 304.89719 309.97198 313.67999 316.20239"
         y="95.952003"
         id="tspan180">klare det. </tspan></text>

       xml:space="preserve"
       transform="matrix(1,0,0,-1,79.37,183.6772)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:12px;font-family:Minion;-inkscape-font-specification:Minion-Regular;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text214"><tspan
         x="0 8.7600002 13.764 18.167999 21.204 26.2092 30.613199 33.6492 37.189201 42.4212 48.301201 52.043999 55.236 59.495998 65.375999 68.412003 71.952003 74.975998 79.980003 84.241203 89.281197 92.3172 97.741203 103.9812 110.2812 115.3212 118.3572 122.1012 125.2932 131.8452 137.3172 140.3532 145.64639 150.7104 157.0464 160.0824 166.38361 171.4584 175.1664 177.6888 180.72479 186.69119 192.85921 197.2632 200.29919 205.3392 211.21919 215.4792 220.48441 230.37241"
         y="0"
         id="tspan188">Der er faktisk flere gode ting ved det. For eksem-</tspan><tspan
         x="0 6.3948002 11.4576 14.4816 17.517599 23.913601 29.145599 33.549599 36.585602 39.645599 44.732399 50.204399 53.240398 56.3004 62.504398 65.540398 69.8004 75.968399 85.8564 95.7444 100.7844 103.8204 107.5644 110.7564 117.0564 122.0616 126.4656 129.5016 133.0416 137.5764 140.7684 143.2908 146.3268 152.8788 158.11079 162.5148 165.5508 170.78281 173.8656 176.8896 181.9296 184.96561 190.1976 196.7496 203.0856 207.3456 212.3856"
         y="15.996"
         id="tspan190">pel har jeg jo somme tider fri, når alle andre </tspan><tspan
         x="0 5.2319999 9.7788 15.9948 21.177601 24.2376 30.538799 35.543999 39.276001 41.799599 44.835602 53.7048 59.1768 62.212799 66.472801 71.704803 74.740799 80.620796 85.852798 92.4048 95.440804 98.500801 103.5876 109.0596 112.0956 117.9756 124.1796 130.3956 135.43559 138.4716 141.6636 148.21561 154.55161 157.5876 163.8156 169.2876 172.32359 177.79559 183.0276 186.0636 189.8064 192.9984 196.0224 199.0584 202.5984 207.13319 210.3252 214.58521 220.7892 225.0504 230.0544 236.6064"
         y="31.992001"
         id="tspan192">arbejder. Og så kan jeg købe ind og gå til frisøren </tspan><tspan
         x="0 6.2280002 11.7 14.736 18.996 24.228001 30.563999 35.796001 42.348 45.383999 51.936001 58.1628 63.612 68.686798 72.394798 75.430801 78.622803 81.658798 85.198799 89.458801 94.522797 100.8588 103.8948 110.1216 115.5936 118.6296 122.8668 128.784 131.3064 134.34241 144.7236 149.72881 156.28081 159.3168 165.618 170.69279 174.4008 177.4368 182.442 186.84599 189.882 196.1088 201.6516 205.91161 211.1436 214.1796 217.2036 220.3956 226.7316 230.43961"
         y="47.987999"
         id="tspan194">og sådan noget i fred og ro. Men det er også lidt </tspan><tspan
         x="0 3.1919999 7.7280002 12.2628 15.4548 19.057199 24.062401 28.322399 33.327599 39.879601 46.180801 51.220798 53.743198 56.779202 62.0112 65.7192 68.755203 78.643204 83.875198 90.4272 93.463203 96.655197 102.5352 108.2016 113.2416 116.2776 121.5096 124.5336 128.2764 131.4684 137.8044 140.84039 146.13361 151.1964 157.53239 160.56841 166.9644 172.0284 175.0524 178.76041 181.7964 188.09641 192.5004 200.3484 205.3524 208.5444 212.8044 216.51241 219.03481"
         y="63.984001"
         id="tspan196">irriterende, at man ikke altid ved helt præcist, </tspan><tspan
         x="0 5.9772 11.1384 17.187599 21.5532 27.985201 33.097198 37.381199 40.297199 50.065201 55.1772 61.6092 64.5252 68.665199 74.425201 79.537201 82.4412 85.357201 90.4692 94.897202 100.992 106.0548 108.9948 115.176 120.096 122.4984 125.4144 131.52119 136.8732 139.7892 145.7664 150.9276 156.97681 161.34241 167.7744 172.8864 177.17039 180.0864 189.8544 194.9664 201.39841 204.31441 210.59039 215.70239 219.9864 222.9024 226.3224 230.7372 233.8092"
         y="79.980003"
         id="tspan198">hvornår man skal arbejde, og hvornår man har fri.</tspan><tspan
         x="0"
         y="111.984"
         id="tspan200"> </tspan><tspan
         x="272.12399 278.1864 283.4184 289.2984 293.0412 296.23318 300.49319 306.3732 309.40921 314.4144 318.81839 321.8544 328.15561 333.15961 337.5636 340.59961 346.47961 352.95959 359.5116 362.54761 367.55161 374.10361 377.13959 380.88361 384.07559 390.62759 396.2424 398.7648 401.80081 408.78601 411.81 418.0488 424.3848 430.686 435.09 441.29401 446.58719 451.59241 455.9964 459.03241 465.36841 470.6004 473.63641 477.89639 487.78439 493.01639"
         y="-0.012"
         id="tspan202">Faktisk er der kun en ting. Blodprøver på små </tspan><tspan
         x="272.12399 278.30399 284.508 288.99359 295.54559 298.06799 301.104 311.62921 316.86121 323.41321 326.44919 332.32919 337.56119 344.11319 347.1492 350.65439 356.82239 361.29721 367.17719 370.2012 375.4332 379.69321 384.73318 387.7692 392.02921 395.6196 401.78879 406.0488 411.08881 414.12479 420.30481 426.50879 430.99438 437.54639 440.06879 443.1048 449.202 454.48441 460.6524 465.1152 468.62039 474.78839 479.19241"
         y="15.984"
         id="tspan204">børn. Man kan forklare store børn, hvorfor </tspan><tspan
         x="272.12399 282.01199 287.24399 293.79599 296.832 301.09201 306.97198 312.20401 315.228 318.26401 321.97198 327.20401 332.6532 337.69321 340.72919 345.73318 352.28519 355.3212 361.47839 364.50241 370.74121 377.07721 383.37839 387.78241 393.98639 399.2796 404.31961 407.35559 413.69159 418.92361 421.95959 428.25961 433.2648 443.1528 445.6752 448.71121 459.0936 464.0976 470.6496 473.68561 480.0816 485.1456 488.16959 491.87759"
         y="31.98"
         id="tspan206">man skal tage en blodprøve på dem. Men helt </tspan><tspan
         x="272.12399 276.384 286.272 291.504 294.54001 300.72 306.92401 311.40961 317.96161 320.99759 326.87759 332.10959 338.66159 341.6976 344.88959 350.76959 356.43481 361.47479 364.5108 368.01599 374.18399 378.56519 382.8252 386.5332 391.7652 394.80121 401.1012 406.17719 409.88519 412.40759 415.4436 424.31281 429.78479 432.8208 439.12201 444.19681 447.90479 450.9408 455.94479 460.34879 463.3848 468.61679 471.64081 475.34879 479.6088 484.84079"
         y="47.976002"
         id="tspan208">små børn kan ikke forstå det. Og det er altså </tspan><tspan
         x="272.12399 275.31601 281.19601 286.8624 291.9024 294.93839 299.19839 302.25839 308.32919 313.8132 317.52121 320.55719 325.78922 329.49719 332.5332 336.79321 342.67319 349.1532 352.23599 355.26001 360.29999 363.336 367.59601 371.33881 374.53079 380.4108 386.07599 391.116 394.15201 397.34399 400.38 404.64001 409.87201 416.20801 421.44 427.992 431.02802 436.0332 442.58521 445.62119 448.6452 451.83719 454.91879 457.94281 462.98279 466.0188 471.05881 477.61081 480.13321 483.16919 489.4704 494.47559 498.87961"
         y="63.972"
         id="tspan210">ikke sjovt at skulle stikke i sådan en lille én, der </tspan><tspan
         x="272.12399 277.728 282.13199 289.98001 296.28 301.28519 305.0184 307.5408 310.57681 319.33679 324.41159 328.1196 331.15561 336.62759 342.8316 347.2356 350.27161 356.43961 362.99161 369.32761 373.03561 376.07159 379.26361 385.81561 392.11679 397.1568 400.19281 403.3848 406.42081 416.30881 419.50079 424.97281 428.00879 434.10599 439.3992 444.40439 448.80841 451.84439 457.37521 462.60721 469.15921 474.77399 477.29639"
         y="79.968002"
         id="tspan212">græder. Det gør ondt inde i mig hver gang. </tspan></text>
